import "./App.css";
import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function Home() {
  const handleClick = () => {
    window.location.href = "/first";
  };
  return (
    <div className="container">
      <div className="question">재혁아 나 사랑해?</div>
      <div className="choice-button">
        <button onClick={handleClick}>Yes</button>
      </div>
    </div>
  );
}

function First() {
  const [password, setPassword] = useState("");

  const onChange = (e) => {
    setPassword(e.target.value);
  };

  const handleLogin = () => {
    if (password == "120613") {
      window.location.href = "/second";
    } else {
      alert("우리 집 안올거야?");
    }
  };

  return (
    <div className="container">
      <div className="question">home password?</div>
      <div className="answer-input">
        <input type={"password"} onChange={onChange} value={password}></input>
      </div>
      <div className="choice-button">
        <button onClick={handleLogin}>로그인</button>
      </div>
    </div>
  );
}

function Second() {
  return (
    <div className="container">
      <div className="question">재혁아 나 사랑해?</div>
      <div className="choice-button">
        <button>Yes</button>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/first">
            <First />
          </Route>
          <Route path="/second">
            <Second />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
